import Link from 'next/link';
import Navigation from "../components/Nav";

export default function About() {
  return (
    <div>

      <Navigation />

      <div className="about-header">
        <h1>About</h1>
        <h3>Code Blue is a mental health web app to help stressed out YC students.</h3>
      </div>

    </div>
  );
}
